import React, { useState, useEffect } from 'react';
import { X, Crown, Star, Zap, CheckCircle, ArrowRight } from 'lucide-react';

interface PremiumAdModalProps {
  isOpen: boolean;
  onClose: () => void;
  onSkip: () => void;
  onUpgrade: () => void;
  visitCount: number;
}

const PremiumAdModal: React.FC<PremiumAdModalProps> = ({
  isOpen,
  onClose,
  onSkip,
  onUpgrade,
  visitCount
}) => {
  const [timeLeft, setTimeLeft] = useState(30);

  useEffect(() => {
    if (isOpen) {
      setTimeLeft(30);
      const timer = setInterval(() => {
        setTimeLeft(prev => {
          if (prev <= 1) {
            clearInterval(timer);
            return 0;
          }
          return prev - 1;
        });
      }, 1000);

      return () => clearInterval(timer);
    }
  }, [isOpen]);

  if (!isOpen) return null;

  const features = [
    {
      icon: <Crown className="w-5 h-5 text-amber-500" />,
      title: "Premium Listings",
      description: "Get priority placement in search results"
    },
    {
      icon: <Zap className="w-5 h-5 text-blue-500" />,
      title: "Instant Notifications",
      description: "Be the first to know about new properties"
    },
    {
      icon: <Star className="w-5 h-5 text-purple-500" />,
      title: "Advanced Filters",
      description: "Access exclusive search and filter options"
    },
    {
      icon: <CheckCircle className="w-5 h-5 text-green-500" />,
      title: "Verified Properties",
      description: "Access to verified and premium properties only"
    }
  ];

  return (
    <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50 p-4">
      <div className="bg-white rounded-2xl shadow-2xl max-w-md w-full overflow-hidden">
        {/* Header */}
        <div className="relative bg-gradient-to-r from-amber-500 to-orange-500 p-6 text-white">
          <button
            onClick={onClose}
            className="absolute top-4 right-4 text-white hover:text-gray-200 transition-colors"
          >
            <X className="w-6 h-6" />
          </button>
          
          <div className="text-center">
            <div className="inline-flex items-center justify-center w-16 h-16 bg-white bg-opacity-20 rounded-full mb-4">
              <Crown className="w-8 h-8 text-white" />
            </div>
            <h2 className="text-2xl font-bold mb-2">Unlock Premium Features</h2>
            <p className="text-amber-100">
              You've viewed {visitCount} properties! Ready to upgrade your experience?
            </p>
          </div>
        </div>

        {/* Content */}
        <div className="p-6">
          <div className="space-y-4 mb-6">
            {features.map((feature, index) => (
              <div key={index} className="flex items-start space-x-3">
                <div className="flex-shrink-0 mt-0.5">
                  {feature.icon}
                </div>
                <div>
                  <h3 className="font-semibold text-gray-900">{feature.title}</h3>
                  <p className="text-sm text-gray-600">{feature.description}</p>
                </div>
              </div>
            ))}
          </div>

          {/* Pricing */}
          <div className="bg-gray-50 rounded-lg p-4 mb-6">
            <div className="text-center">
              <div className="text-3xl font-bold text-gray-900 mb-1">$9.99</div>
              <div className="text-sm text-gray-600">per month</div>
              <div className="text-xs text-green-600 font-medium mt-1">
                Save 50% on your first month!
              </div>
            </div>
          </div>

          {/* Action Buttons */}
          <div className="space-y-3">
            <button
              onClick={onUpgrade}
              className="w-full bg-gradient-to-r from-amber-500 to-orange-500 text-white font-semibold py-3 px-6 rounded-lg hover:from-amber-600 hover:to-orange-600 transition-all duration-200 flex items-center justify-center space-x-2"
            >
              <Crown className="w-5 h-5" />
              <span>Upgrade to Premium</span>
              <ArrowRight className="w-4 h-4" />
            </button>
            
            <button
              onClick={onSkip}
              className="w-full text-gray-600 hover:text-gray-800 py-2 px-4 rounded-lg hover:bg-gray-100 transition-colors"
            >
              Maybe Later
            </button>
          </div>

          {/* Timer */}
          <div className="mt-4 text-center">
            <div className="text-xs text-gray-500">
              This offer expires in {timeLeft} seconds
            </div>
            <div className="w-full bg-gray-200 rounded-full h-1 mt-2">
              <div 
                className="bg-gradient-to-r from-amber-500 to-orange-500 h-1 rounded-full transition-all duration-1000"
                style={{ width: `${(timeLeft / 30) * 100}%` }}
              />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default PremiumAdModal;
